	getZite(auth_address, id) {
		var query = `
			SELECT *
				${app.userInfo && app.userInfo.auth_address ? ", (" + this.subQueryBookmarks() + ")" : ""}
			FROM zites
			LEFT JOIN json USING (json_id)
			WHERE id=${id} AND json.directory='users/${auth_address}'
			LIMIT 1
			`;
		return page.cmdp("dbQuery", [query]);
	}

